INSERT INTO `attraction` VALUES (1,1852,'Gangaramaya (Vihara) Buddhist Temple','3,096','-','+94112435169','-','-','http://gangaramaya.com/','6.917910','79.857872','https://www.tripadvisor.com//Attraction_Review-g293962-d552525-Reviews-Gangaramaya_Vihara_Buddhist_Temple-Colombo_Western_Province.html'),(2,804,'Temple of the Sacred Tooth Relic','12,004','Sri Dalada Veediya, Kandy 20000 Sri Lanka','+94812234226','mailto:info@sridaladamaligawa.lk','Sri Dalada Maligawa (Sinhala: ශ්‍රී දළදා මාළිගාව) or The Temple of the Sacred Tooth Relic is a Buddhist temple in the city of Kandy, Sri Lanka. It is located in the royal palace complex which houses the Relic of the tooth of Buddha. Since ancient times, the relic has played an important role in local politics because it is believed that whoever holds the relic holds the governance of the country. Kandy was the last capital of the Sinhalese kings and is a UNESCO world heritage site partly due to the temple. The temple which houses the Sacred Tooth Relic of the Buddha is one of the holiest shrines in the entire Buddhist world.','http://www.sridaladamaligawa.lk/','7.293626','80.641335','https://www.tripadvisor.com//Attraction_Review-g304138-d317476-Reviews-Temple_of_the_Sacred_Tooth_Relic-Kandy_Kandy_District_Central_Province.html'),(3,548,'Main Fish Market','267','-','+94728634177','-','-','-','7.210529','79.831238','https://www.tripadvisor.com//Attraction_Review-g297897-d10038168-Reviews-Main_Fish_Market-Negombo_Western_Province.html'),(4,400,'Galle Fort','3,445','Church Street, Galle 80000 Sri Lanka','-','-','Galle is located in the south of Sri Lanka. A journey to the past sees the remnants of a Dutch past at a World Heritage Site. Galle has been the emporium of foreign trade since the dawn of commerce. The Dutch Fort, which has been declared a World Heritage Site, surrounds the older part of the town and is situated on a headland of which three sides overlook the sea. The ramparts of the Fort are over 2.5 km in circumference and provide a pleasant and interesting walk. The historian Sir Emerson Tennant claimed that Galle was the ancient biblical city of Tarshish. This city is said to have traded with King Solomon, the Persians and the Egyptians. In 1505 a Portuguese fleet led by Lorenzo de Almeida heading for the Maldives drifted accidentally into Galle. On hearing a cock crowing (cock means ”Galo” in Portuguese), it is said that they gave the town its name. Another explanation for the name is from the Sinhala name for rock ‘Gala’, plenty of which are found in the harbour area.','-','6.029550','80.216110','https://www.tripadvisor.com//Attraction_Review-g297896-d3617497-Reviews-Galle_Fort-Galle_Galle_District_Southern_Province.html'),(5,204,'Little Adam\'s Peak','5,510','Passara Road, Ella 90090 Sri Lanka','-','-','-','-','6.865063','81.063072','https://www.tripadvisor.com//Attraction_Review-g616035-d2478367-Reviews-Little_Adam_s_Peak-Ella_Uva_Province.html');
