INSERT INTO `hotel` VALUES (1,1,'Beach Guest House Addalaichenai','3,892','0','Beach Road, Addalaichenai 32000 Sri Lanka','-','-','-','-','7.250977','81.863663'),(2,1,'Thompukandam Village Resort','47,891','20','No. 72 Addapalam, Ninthavur, Ampara 32000 Sri Lanka','-','-','-','3.0','7.321017','81.857758'),(3,1,'Quench Inn','1,968','1','C/279/5, Senanayakapura, Ampara 32000 Sri Lanka','-','-','-','-','7.285041','81.686760'),(4,1,'Light House Beach Hut','720','5','Lighthouse Road, Komari 32500 Sri Lanka','-','-','-','-','7.025424','81.876991'),(5,1,'Aprota Villas Arugambay','72,046','47','Aprota Villas Arugambay Sedo Vadakku Veethy, Urani Sedo Vadakku Veethy, Urani, Pottuvil, Arugam Bay 32500 Sri Lanka','-','Aprota Villas Arugambay, A beachfront luxury boutique property with chalets and villas, situated in the unspoilt eastern shores of Sri Lanka. We are few minutes\' drive away from the famous Arugam Bay surfing point and walking distance to famous Whiskey Point.Read more','-','-','6.917270','81.845444'),(6,1,'Rathnapriya Safari Guest Galoya','6,498','6','2/A, Rathnapriya Dam Road Near The National Park Entrance, Inginiyagala, Inginiyagala 91040 Sri Lanka','-','Rathnapriya Safari Guest Galoya set in Ampara.Amoung the various facilities & various activities of this property are free bikes,free wi-fi, a terrace & jeep & boat safari,hicking, & fishing guests can enjoy near the accomadation.The guest house features are mountain view,children\'s play ground & 24 hour front desk.With a privert bathroom,rooms at also offer garden view.Read more','-','-','7.219532','81.543320'),(7,1,'Whisky Point Surf Cabana','7,205','4','Arugam Bay 32500 Sri Lanka','-','5 Mitutes walk to whisky pointRead more','-','-','6.913230','81.845848'),(8,1,'Exotic Beach Hotel','7,581','0','Kanthaiya St Whisky Point, Pottuvil, Arugam Bay 32500 Sri Lanka','-','-','-','-','6.911572','81.844162'),(9,1,'Eco Aloevera Garden','3,249','0','Whisky point Urani, Pottuvil, Arugam Bay 32500 Sri Lanka','-','-','-','-','6.908028','81.843323'),(10,1,'Paper Moon Kudils','34,644','113','Whisky Point Arugambay, Pottuvil, Arugam Bay 32500 Sri Lanka','-','Overlooking the Whisky Point surfing spot in Arugam Bay, Paper Moon Kudils of Whisky Point Resorts is a beachside getaway made up of a cluster of rustic ‘kudils’ that offer a charmed way of life. Whisky Point is a popular spot for novice surfers with slow rolling waves. Combined with the laidback beach expanse the ‘Kudils’ offer a potent setting for letting loose and embracing a simple beach lifestyle. Things are run in an unconventional way at Paper Moon Kudils, which is very much a part of the locality. Expect some warm hospitality and your input and encouragement are highly valued at any time. While you ease into your home away from home, there are a few DIYs to keep in mind during your stay to encourage energy efficiency and environmentally friendly ways of holidaying to your heart’s content. Read on and find out more. Arugambay Roccos, our sister property, is located along Main Street, Arugambay.Read more','-','3.0','6.908012','81.842560'),(11,1,'Riva Del Sole',' 12,274','11','Kanagar Village Urani, Pottuvil, Arugam Bay 32500 Sri Lanka','-','Featuring a garden, Riva del Sole is located in Arugam Bay and is 8 km from Muhudu Maha Viharaya. Providing a restaurant, the property also features a terrace. Magul Maha Viharaya is 19.3 km from the resort. All guest rooms at the resort come with a seating area. Every room is equipped with a private bathroom and a bath, and certain units at Riva del Sole have a balcony.Read more','-','-','6.907790','81.841431'),(12,1,'Aliya Village','23,415','0','Whisky Point, Kurangumadu Urani, Pudududiyiruppu 32500 Sri Lanka','-','-','-','-','6.907193','81.840904'),(13,1,'De Perla Resort','11,790','10','Whisky Point, Arugam Bay 32500 Sri Lanka','-','There are 2 no of separate rooms available with bathroom. This property is located from 3 min walking distance to main surf point whiskey point.Read more','-','-','6.906835','81.842117'),(14,1,'Reddalf\'s Holiday Resort','16,210','2','292 Kottukal Central Road Wiskey Point, Arugam Bay 32500 Sri Lanka','-','-','-','-','6.905880','81.843262'),(15,1,'Whisky Point Resort',' 5,764','51','Whisky Point Road, Pottuvil, Arugam Bay 32500 Sri Lanka','-','Choose between a Wooden Cabana with a Balcony or Patio and a Private Bathroom or an Open Air Pagoda with a shared bathroom. All our rooms offer ocean views. We provide unlimited drinking water to avoid plastic, daily refreshment of the room, fine bed linens and towels, WiFi, room Service – everything for you to enjoy a tropical life with a touch of luxury!Read more','-','-','6.905878','81.843300'),(16,1,'Prime Surfers Bungalow','15,884','0','Surfers Street, Whiskey Point, Pottuvil, Arugam Bay 32500 Sri Lanka','-','-','-','-','6.905534','81.841125'),(17,1,'The Coconut Homestay, Bar & Restaurant','5,054','1','Whiskey Point, Urani Arugam Bay, Batticaloa 32500 Sri Lanka','-','-','-','-','6.903448','81.840706'),(18,1,'Dream Garden Resort','26,185','49','Whiskey Point Road Koddukal, Urani, Pottuvil, Arugam Bay 32500 Sri Lanka','-','Dream Garden Resort is a tropical oasis, located at Whisky Point on Sri Lanka’s east coast, near Arugam Bay. Our resort with restaurant, bar and swimming pool is nested between two world famous surf breaks at walking distance, Whisky (200m) and Pottuvil Point (500m) and offer 10 spacious AC accommodations from Deluxe single and double rooms to studios and family bungalow with kitchen. At Dream Garden, you will enjoy quiet nights, relax in our lushy tropical garden, enjoy our restaurant and pool just 15 minutes away (10km) from the hustle and bustle of Arugam Bay. Our restaurant serves authentic italian specialities (pizza, homemade pasta, prosciutto...), seafood dishes, but also the main \"must try\" Sri Lankan specialities. Our bar has the full liquor license and offers cocktails, beers and imported wines and liquors. Beside surfing, we can easily organise some boat safaris on the nearby lagoon or half day package to Kumana National Park.Read more','-','3.0','6.901990','81.842850'),(19,1,'Ecoland Resort','8,285','0','Whisky Point Pudududiyiruppu, Pottuvil, Arugam Bay 32500 Sri Lanka','-','Ecoland resort is nested on a large and wild piece of land, walking distance from whisky surfing point (one of the best surf break in Arugam Bay)Read more','-','-','6.900155','81.841599'),(20,3,'1. Thompukandam Village Resort','47,891','20','No. 72 Addapalam, Ninthavur, Ampara 32000 Sri Lanka','-','-','-','3.0','7.321017','81.857758'),(21,3,'2. GreenBees Nature Farm','15,932','1','Dumana Wewa, Pollebedda, Maha Oya, Ampara 32000 Sri Lanka','-','Farm house and camping site.Read more','-','-','7.458399','81.364899'),(22,3,'3. Explorer by Mahoora - Maduru Oya','568,890','1','Maduru Oya National Park, Ampara 51108 Sri Lanka','-','Explorer by Mahoora is a highly unique and immersive experience of living with untamed Sri Lankan wildlife inside National Parks and Nature Reserves across the country. Our Private Tented Safari Camp Experience in Maduru Oya National Park is on the banks of Maduru Oya Reservoir. The property features mountain and lake views.Read more','-','-','7.647636','81.186821');
